import React from "react";

export default function Alert(props) {
  return (
    props.alert && (
      <div
        className={`alert alert-warning alert-dismissible fade ${
          props.alert == false ? "hide" : "show"
        }`}
        role="alert"
      >
        <strong>{props.alert.type}</strong> : {props.alert.msg}
      </div>
    )
  );
}
